package com.zwk.news;

public class TypeItem {
	private String id;//
	private String type;//

	public TypeItem() {
		super();
		// TODO Auto-generated constructor stub
	}

	public TypeItem(String id, String type) {
		super();
		this.id = id;
		this.type = type;
	}

	public String getId() {
		return id;
	}

	public void setId(String id) {
		this.id = id;
	}

	public String getType() {
		return type;
	}

	public void setType(String type) {
		this.type = type;
	}

}
